function About () {
    return(
        <div>
            <p>Topkapı Üniversitesi Bilgisayar Programlama bölümünden mezun oldum. Stajıma Modanisa firmasında başladım. Yaklaşık 3 ay süren staj dönemimi tamamladım. Stajımdan sonra “Nuxt.js”te kendimi geliştirmeye devam ettim. Şuan "Nuxt.js/React.js/Next.js" ve "Node.js" ile projeler geliştiriyorum. "Node.js"in yanında, "Express.js", "Cors, JWT, Token ve Mongoose" kütüphanelerini kullanıyorum. 

Şuan aktif olarak Junior Frontend Developer, Full-Stack Developer ve Junior Backend Developer pozisyonlarında iş arıyorum. Önceliğim Junior "Frontend Developer".
GitHub’ımda geliştirdiğim projeler var, yukarıda belirttiğim pozisyonlarda olarak çalışmak istiyorum.

Geliştirdiğim projelere GitHub üzerinden ulaşabilirsiniz: https://github.com/BGNDGN?tab=repositories

Bunların dışında kendim öğrendiğim programlama dilleri var; C, C# ve PHP.
Bu programlama dillerini online eğitim alarak ve okulda edindiğim bilgilerle öğrenmeye başladım ve kendimi geliştirdim.</p>
        </div>
    )
}

export default About;
